using System;
using System.Collections.Generic;
using System.Linq;
using System.Xml;
using Newtonsoft.Json;
using Newtonsoft.Json.Linq;

public static class Snippet
{
	public static System.String func(System.String myjson)
	{
            string result = "";
            JObject jo = JObject.Parse(myjson);
            var mlist = jo.SelectToken("Carriers").ToList();

            var carrierid = "";
            var carrierlabel = "";
		    var carrierservice = "";
            foreach (JProperty prop in jo.SelectToken("Carriers"))
            {
                string name = prop.Name;                
                var mlist3 = jo.SelectToken("Carriers."+name).ToList();
                for (var i = 0; i < mlist3.Count; i++) {                   

                    carrierid = jo.SelectToken("Carriers." + name + "[" + i.ToString() + "].CarrierID").ToString();
                    carrierlabel = jo.SelectToken("Carriers." + name + "[" + i.ToString() + "].Label").ToString();
                    carrierservice = jo.SelectToken("Carriers." + name + "[" + i.ToString() + "].CarrierService").ToString();
					if (carrierlabel == "") { carrierlabel = name; }

                   result = result + carrierid + "~"+carrierlabel+"~"+carrierservice+"\r\n";
                    }
            }			
		return result;
	}

}
